import "./styles.css";

const ICON = `<svg width="14px" height="18px" viewBox="0 0 14 18" version="1.1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink"><title>5d569e0d5cb6b74c1fab4539_favicon_color</title><desc>Created with Sketch.</desc><defs></defs><g id="Page-1" stroke="none" stroke-width="1" fill="none" fill-rule="evenodd"><image id="5d569e0d5cb6b74c1fab4539_favicon_color" x="-6" y="-4" width="25" height="25" xlink:href="data:image/png;base64,"></image></g></svg>`;

const DEFAULT_DATA = {
    link: null,
    provider: null,
    html: null,
    frame: null,
    id: null,
    thumbnail: null
};

const PROVIDERS = {
    playbuzz: {
        regex: /https:\/\/www\.playbuzz\.com\/(.+?)\/(.+?)\/?$/g,
        fetchInfo: async link => {
            const match = PROVIDERS["playbuzz"].regex.exec(link);
            PROVIDERS["playbuzz"].regex.lastIndex = 0;
            const response = await fetch(
                `//oembed.playbuzz.com/item?id=${match[2]}`
            );
            const result = await response.json();
            if (response.ok) {
                return {
                    link: link,
                    provider: "playbuzz",
                    thumbnail: result.thumbnail_url,
                    html: result.html,
                    id: match[2]
                };
            }
        }
    }
};

class QuizTool {
    constructor({ data, config, api }) {
        this.api = api;
        this.config = config;
        this.nodes = {
            input_wrapper: null,
            input: null,
            container: null
        };
        this._data = { ...DEFAULT_DATA };
        this.data = data;
    }

    static get toolbox() {
        return {
            title: "Quiz",
            icon: ICON
        };
    }

    /**
     * Create element with styles
     * @param {string} tag
     * @param {Array<string>} classes
     */
    makeElement(tag, classes) {
        const element = document.createElement(tag);
        element.classList.add(...classes);
        return element;
    }

    render() {
        this.nodes.container = this.makeElement("div", "tool-quiz__container");
        this.nodes.container.appendChild(this.makeInput());
        this.applyInitialState();
        return this.nodes.container;
    }

    set data(data) {
        this._data = Object.assign({}, DEFAULT_DATA, data);
    }

    get data() {
        return this._data;
    }

    save(blockContent) {
        return this.data;
    }

    validate() {
        if (this.data.provider && this.data.link) {
            return true;
        }
        return false;
    }

    /**
     * If data is valid we must to set link to input and change style to 'ready'
     */
    applyInitialState() {
        if (this.validate()) {
            this.nodes.input.value = this.data.link;
            this.setReady();
        }
    }

    /**
     * Create input element and setup listeners
     */
    makeInput() {
        this.nodes.input_wrapper = this.makeElement("div", ["cdx-block"]);
        this.nodes.input = this.makeElement("input", [
            "quiz-tool__input",
            "cdx-input"
        ]);
        this.nodes.input_wrapper.appendChild(this.nodes.input);
        // listeners
        this.nodes.input.addEventListener("paste", event => {
            setTimeout(() => {
                this.startFetching(event.target.value);
            }, 0);
        });
        this.nodes.input.addEventListener("keydown", event => {
            const [ENTER] = [13];
            if (event.keyCode === ENTER) {
                event.preventDefault();
                event.stopPropagation();
                this.startFetching(event.target.value);
            }
        });
        return this.nodes.input_wrapper;
    }

    /**
     * Change input style to 'error'
     */
    setError() {
        this.nodes.input.classList.remove("quiz-tool__input_ready");
        this.nodes.input.classList.add("quiz-tool__input_error");
    }

    /**
     * Change input style to 'ready'
     */
    setReady() {
        this.nodes.input.classList.remove("quiz-tool__input_error");
        this.nodes.input.classList.add("quiz-tool__input_ready");
    }

    /**
     * Get provider by link(value in input)
     * @param {string} link
     */
    defineProvider(link) {
        for (let key in PROVIDERS) {
            const match_result = link.match(PROVIDERS[key].regex);
            if (match_result) {
                return PROVIDERS[key];
            }
        }
    }

    /**
     * Fetch information about quiz from provider
     * @param {string} link
     */
    async startFetching(link) {
        const provider = this.defineProvider(link);
        if (provider) {
            this.data = await provider.fetchInfo(link);
            this.setReady();
        } else {
            this.setError();
        }
    }
}

export default QuizTool;
